var GetChildrenWidth = function (minimumMode) {
    if (this.rexSizer.hidden) {
        return 0;
    }

    if (minimumMode === undefined) {
        minimumMode = true;
    }

    var result = 0;
    var children = this.sizerChildren;
    var child, proportion, padding, childWidth;
    var hasUnknownChildWidth = false;
    var totalProportion = this.childrenProportion; // To update this.hasProportion0Child member

    if (this.orientation === 0) { // x
        // Get summation of minimum width
        var itemSpace = this.space.item;
        var isFirstChild = true;
        for (var i = 0, cnt = children.length; i < cnt; i++) {
            child = children[i];
            if (child.rexSizer.hidden) {
                continue;
            }

            proportion = child.rexSizer.proportion;
            if ((proportion === 0) || minimumMode) {
                childWidth = this.getChildWidth(child);
                if (childWidth === undefined) {
                    if ((proportion !== 0) && (!this.hasProportion0Child)) {
                        childWidth = 0;
                    } else {
                        hasUnknownChildWidth = true;
                    }
                }
            } else {
                childWidth = 0;
            }

            if (hasUnknownChildWidth) {
                continue;
            }

            padding = child.rexSizer.padding;
            childWidth += (padding.left + padding.right);

            if (isFirstChild) {
                isFirstChild = false;
            } else {
                childWidth += itemSpace;
            }

            result += childWidth;
        }
    } else {
        // Get maximun width
        for (var i = 0, cnt = children.length; i < cnt; i++) {
            child = children[i];
            if (!child.hasOwnProperty('rexSizer')) {
                continue;
            }
            if (child.rexSizer.hidden) {
                continue;
            }

            childWidth = this.getChildWidth(child);
            if (childWidth === undefined) {
                hasUnknownChildWidth = true;
            }

            if (hasUnknownChildWidth) {
                continue;
            }

            padding = child.rexSizer.padding;
            childWidth += (padding.left + padding.right);

            result = Math.max(childWidth, result);
        }
    }

    if (hasUnknownChildWidth) {
        return undefined;
    }

    return result + this.space.left + this.space.right;
}

